import React from "react";

import Layout from "../../components/Layout";

const SignUp = () => {
  return (
    <React.Fragment>
      <Layout>
        <main>
          <h1>Sign Up</h1>
          <label htmlFor="username">Username: </label>
          <input type="text" id="username" name="username" />
        </main>
      </Layout>
    </React.Fragment>
  );
};

export default SignUp;
